import Content1 from "./components/Content1/Main";
import Shape from "./components/Content1/Shape";
import Card from "./components/Content2/Card";

function App() {
  return (
    <div>
      <Content1 />
      <Shape />
      <div className="pt-5">
        <Card />
      </div>
    </div>
  );
}

export default App;
